import React from 'react';
import { Container, Typography, Button, Box, Stack, Grid, Paper, Chip, Divider } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import LocalHospitalIcon from '@mui/icons-material/LocalHospital';
import SupportAgentIcon from '@mui/icons-material/SupportAgent';
import PublicIcon from '@mui/icons-material/Public';
import PlayCircleOutlineIcon from '@mui/icons-material/PlayCircleOutline';

const highlights = [
  {
    icon: <LocalHospitalIcon sx={{ fontSize: 48, color: '#1976d2' }} />,
    title: '2100+ Qualified Doctors',
    desc: 'Expert medical professionals across specialties.'
  },
  {
    icon: <SupportAgentIcon sx={{ fontSize: 48, color: '#1976d2' }} />,
    title: '1000+ Hospitals',
    desc: 'JCI-accredited partners worldwide.'
  },
  {
    icon: <PublicIcon sx={{ fontSize: 48, color: '#1976d2' }} />,
    title: '800+ Treatment Plans',
    desc: 'Comprehensive solutions for global patients.'
  }
];

const partnerLogos = [
  { name: 'Apollo', url: '/partner-apollo.png' },
  { name: 'Fortis', url: '/partner-fortis.png' },
  { name: 'Max Healthcare', url: '/partner-max.png' },
  { name: 'Medanta', url: '/partner-medanta.png' },
  { name: 'BLK', url: '/partner-blk.png' },
  { name: 'Manipal', url: '/partner-manipal.png' },
];

const Home = () => (
  <Box sx={{ background: 'linear-gradient(135deg, #181c32 0%, #23294d 100%)', minHeight: '100vh', pb: 8 }}>
    <Container maxWidth="lg" sx={{ pt: { xs: 6, md: 10 }, textAlign: { xs: 'center', md: 'left' } }}>
      <Grid container spacing={6} alignItems="center" justifyContent="center">
        <Grid item xs={12} md={6}>
          <Box sx={{ maxWidth: 520, mx: { xs: 'auto', md: 0 } }}>
            <Typography variant="h3" fontWeight="bold" gutterBottom sx={{ fontFamily: 'serif', color: '#fff' }}>
              AI Front Office<br />For Healthcare Agents
            </Typography>
            <Typography variant="h6" color="#bbdefb" gutterBottom sx={{ fontFamily: 'serif' }}>
              Create <b>AI Store</b> in 2 min<br />Scale with <b>Digital Marketing</b>
            </Typography>
            <Stack direction={{ xs: 'column', sm: 'row' }} spacing={2} mt={4} justifyContent={{ xs: 'center', md: 'flex-start' }}>
              <Button
                component={RouterLink}
                to="/signup"
                variant="contained"
                size="large"
                color="primary"
                sx={{ px: 4, fontWeight: 'bold', borderRadius: 8, bgcolor: '#7b1fa2' }}
              >
                Get Started
              </Button>
              <Button
                component={RouterLink}
                to="/login"
                variant="outlined"
                size="large"
                color="inherit"
                sx={{ px: 4, borderRadius: 8, color: '#fff', borderColor: '#fff' }}
              >
                Login
              </Button>
              <Button
                variant="text"
                size="large"
                color="inherit"
                startIcon={<PlayCircleOutlineIcon />}
                sx={{ color: '#bbdefb' }}
              >
                Watch how it works
              </Button>
            </Stack>
            <Grid container spacing={2} mt={3} justifyContent={{ xs: 'center', md: 'flex-start' }}>
              {highlights.map((item, idx) => (
                <Grid item xs={12} sm={4} key={idx}>
                  <Paper elevation={0} sx={{ p: 3, borderRadius: 4, bgcolor: 'rgba(255,255,255,0.04)', color: '#fff', textAlign: 'center' }}>
                    {item.icon}
                    <Typography variant="subtitle1" fontWeight="bold" mt={1} gutterBottom sx={{ fontFamily: 'serif' }}>
                      {item.title}
                    </Typography>
                    <Typography color="#bbdefb">{item.desc}</Typography>
                  </Paper>
                </Grid>
              ))}
            </Grid>
          </Box>
        </Grid>
        <Grid item xs={12} md={6}>
          <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', mt: { xs: 6, md: 0 } }}>
            {/* Logo at the top for mobile, hidden on desktop */}
            <Box sx={{ mb: 4, display: { xs: 'block', md: 'none' } }}>
              <img src="/gogetwell-logo-white.png" alt="GoGetWell AI Logo" style={{ height: 56, width: 'auto' }} />
            </Box>
            {/* Partnered logos: animated horizontal scroll */}
            <Box sx={{ bgcolor: '#fff', borderRadius: 3, p: 3, minWidth: 320, boxShadow: 4, textAlign: 'center', overflow: 'hidden', position: 'relative', width: '100%' }}>
              <Typography variant="subtitle2" fontWeight="bold" color="#7b1fa2" sx={{ mb: 1 }}>
                Trusted by
              </Typography>
              <Box sx={{ width: '100%', overflow: 'hidden', position: 'relative', height: 48 }}>
                <Box
                  sx={{
                    display: 'flex',
                    alignItems: 'center',
                    gap: 5,
                    animation: 'scroll-logos 18s linear infinite',
                    '@keyframes scroll-logos': {
                      '0%': { transform: 'translateX(0)' },
                      '100%': { transform: 'translateX(-50%)' }
                    }
                  }}
                >
                  {[...partnerLogos, ...partnerLogos].map((logo, idx) => (
                    <Box key={idx} sx={{ px: 2, minWidth: 80 }}>
                      <img
                        src={logo.url}
                        alt={logo.name}
                        style={{ height: 36, width: 'auto', filter: 'grayscale(1)', opacity: 0.8 }}
                      />
                    </Box>
                  ))}
                </Box>
              </Box>
            </Box>
            {/* Logo at the bottom for desktop, hidden on mobile */}
            <Box sx={{ mt: 6, display: { xs: 'none', md: 'block' } }}>
              <img src="/gogetwell-logo-white.png" alt="GoGetWell AI Logo" style={{ height: 56, width: 'auto' }} />
            </Box>
          </Box>
        </Grid>
      </Grid>
    </Container>
  </Box>
);

export default Home;
